# https://leetcode.com/problems/longest-substring-without-repeating-characters/


class Solution:
    def lengthOfLongestSubstring2(self, s: str) -> int:
        longest_sub = ""
        longest_sub_l = 0
        hash_tab = {}

        if len(s) == 1:
            return 1

        for i in range(len(s)):
            j = i
            while j < len(s):
                # print("i:", i, "j:", j, "s[j]:", s[j], "hash_tab:", hash_tab)
                if s[j] not in hash_tab:
                    hash_tab.setdefault(s[j], j)
                else:
                    if len(hash_tab.keys()) > len(longest_sub):
                        longest_sub_l = len(hash_tab.keys())
                        longest_sub = hash_tab.keys()
                    hash_tab = {}

                j += 1

            if len(hash_tab.keys()) > len(longest_sub):
                longest_sub_l = len(hash_tab.keys())
                longest_sub = hash_tab.keys()
            hash_tab = {}

        print(
            10 * "*",
            "hash_tab:",
            hash_tab,
            "longest_sub:",
            longest_sub,
            "longest_sub_l:",
            longest_sub_l,
        )
        return longest_sub_l

    def lengthOfLongestSubstring(self, s: str) -> int:
        longest_sub = ""
        longest_sub_l = 0
        longest_sub_holder = ""

        if len(s) == 1:
            return 1

        for i in range(len(s)):
            if s[i] not in longest_sub:
                longest_sub += s[i]
            else:
                if longest_sub_l < len(longest_sub):
                    longest_sub_l = len(longest_sub)
                    longest_sub_holder = longest_sub
                longest_sub = longest_sub[longest_sub.find(s[i]) + 1 :]
                longest_sub += s[i]

        if longest_sub_l < len(longest_sub):
            longest_sub_l = len(longest_sub)
            longest_sub_holder = longest_sub

        # print(
        #     "longest_sub:",
        #     longest_sub,
        #     "longest_sub_l:",
        #     longest_sub_l,
        #     "longest_sub_holder:",
        #     longest_sub_holder,
        # )
        return longest_sub_l


